import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";

import { Routes, Route, BrowserRouter } from "react-router-dom";

import { Landing } from "./components/Landing";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route exact path="/" element={<Landing />} />
        {/* <Route path="/study" element={<Study />} /> */}
      </Routes>
    </BrowserRouter>
  );
}

export default App;
